// SPDX-License-Identifier: MIT

pragma solidity ^0.8.10;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";

contract MiamiAfterDark is ERC721Burnable, Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    bool public presaleLive;
    bool public saleLive;

    uint256 public MAX_MINTABLE_PER_USER = 5;
    uint256 public PRICE = 0.08 ether;
    uint256 public totalSupply = 10000; // 10k

    string private _tokenBaseURI;

    mapping(address => uint256) public presalerListPurchases;

    constructor() ERC721("Miami After Dark", "MAD") {}

    function setBaseURI(string calldata URI) external onlyOwner {
        _tokenBaseURI = URI;
    }

    function _baseURI() internal pure override returns (string memory) {
        return "http://localhost:3000/collectables/";
    }

    function startPresale() external onlyOwner {
        presaleLive = true;
    }

    function startSale() external onlyOwner {
        saleLive = true;
    }

    function buy(uint256 tokenQuantity) external payable {
        require(saleLive, "SALE_CLOSED");
        require(!presaleLive, "TOO_EARLY");
        require(tokenQuantity <= MAX_MINTABLE_PER_USER, "EXCEED_MAX_ALLOWED");
        require(PRICE * tokenQuantity <= msg.value, "INSUFFICIENT_ETH");

        require(
            _tokenIds.current() + tokenQuantity <= totalSupply,
            "EXCEED_MAX_SUPPLY"
        );

        _mintTokensForAddress(msg.sender, tokenQuantity);
    }

    function refundMe(uint256 tokenId) external {
        require(
            _isApprovedOrOwner(msg.sender, tokenId),
            "You are not the owner of this tokenId"
        );
        _burn(tokenId);
        payable(msg.sender).transfer(PRICE);
    }

    function presaleBuy(uint256 tokenQuantity) external payable {
        require(!saleLive && presaleLive, "PRESALE_CLOSED");
        require(
            presalerListPurchases[msg.sender] + tokenQuantity <=
                MAX_MINTABLE_PER_USER,
            "EXCEED_MAX_ALLOWED"
        );
        require(PRICE * tokenQuantity <= msg.value, "INSUFFICIENT_ETH");

        _mintTokensForAddress(msg.sender, tokenQuantity);
    }

    function _mintTokensForAddress(address to, uint256 tokenQuantity) private {
        presalerListPurchases[to] += tokenQuantity;
        for (uint256 i = 0; i < tokenQuantity; i++) {
            uint256 newItemId = _tokenIds.current();
            _tokenIds.increment();
            _mint(to, newItemId);
        }
    }

    function getMinted() public view returns (uint256) {
        return _tokenIds.current();
    }

    // ** - ADMIN - ** //

    function withdraw() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }
}
